import React from 'react';
import Card from './Card';

export default function CardList(props) {
  console.log('CardList props:', props.users.data);
  return (
    <div>
      {props.users.data.map(user => (
        <Card
          name={user.name}
          age={user.age}
          about={user.about}
          key={user.id}
        />
      ))}
    </div>
  );
}
